ul.columns {

    text-align: center;
	  padding-left:0px;
}
ul.columns li a {
    border: solid;
    margin-top: 0px;
    border-color: #4e3880;
    background-color: #4e3880;
    color: white;
    font-weight: bold;
    display: inline-block;
    width:100%;
}
ul.columns li {
    border: solid;
    margin-top: 10px;
    background-color: #4e3880;
    color: white;
    font-weight: bold;
    display: inline-block;
    width: 30%;
}

.image-list-small {
  font-family: Arial, Helvetica, sans-serif;
  margin: 0 auto;
  text-align: center;
  width:100%;
  padding: 0;
}

.image-list-small li {
  display: inline-block;
  width: 150px;
	margin: 15px;

}
.image-list-small li img {

	object-fit: cover;
	height:180px;
	width:150px;
}

/* Photo */

.image-list-small li > a {
  display: flex;
	flex-wrap: wrap;
  height: 180px;
	width: 180px;


}

.image-list-small .details {
  margin-top: 5px;
}


/* Title */

.image-list-small .details h3 {
  display: block;
  font-size: 16px;
  margin: 0 0 3px 0;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

.image-list-small .details h3 a {
  color: #303030;
  text-decoration: none;
}

.image-list-small .details .image-author {
  display: block;
  color: #717171;
  font-size: 11px;
  font-weight: normal;
  margin: 0;

}

.thots {
	background-color:#4e3880;
	border:1px solid #3b6e22;
	display:inline-block;
	cursor:pointer;
	color:#ffffff;
	font-family:Arial;
	font-size:13px;
	font-weight:bold;
	padding-top: 10px;
	width:40px;
	height:25px;
	margin-bottom:5px;
	text-decoration:none;
}
.thots:hover {
	color: #d9251d;
	background-color:#644e95;
}
.thots:active {
	position:relative;
	top:1px;
}
.attachment-bimber-grid-standard.size-bimber-grid-standard.wp-post-image {
  border-width: 0px;
}

.g1-frame-inner {
  border-width: 3px;
  border-color: #4e3880;
}

.entry-todome.g1-dropable.snax {
  display: none;
}

.g1-gamma.g1-gamma-1st.entry-title {
  margin-bottom: 0px;
}

.g1-body-inner .g1-primary-nav-menu>.menu-item {
  display: inline-block;
  vertical-align: middle;
}

body.g1-layout-boxed .g1-body-inner {
  background: url(https://thothub.tv/wp-content/uploads/2018/07/rubber_grip.png) repeat;
}

.g1-mega.g1-mega-1st.entry-title {
  margin-bottom: 0px;
}

.vc_custom_heading {
  display: none;
}

.entry-tags {
  text-align: center;
}

.textwidget {
  text-align: center;
  font-size: 13px;
  text-transform: uppercase;
  text-indent: 0px;
  letter-spacing: 1px;
}

.g1-prefooter h1 {
  font-size: 15px;
  letter-spacing: 1px;
}
.ms-top-bar > h4 > .ms-title {
	color: white;
}
.ms-membership-details-wrapper .ms-top-bar {
    background-color:#4e3880;
    position: relative;
    margin-left: -1px;
    margin-right: -1px;
    margin-top: -1px;
    border-top-left-radius: 3px;
    border-top-right-radius: 3px;
    -webkit-border-top-left-radius: 3px;
    -webkit-border-top-right-radius: 3px;
}
.ms-price-details > .ms-description {
	color: black;
	font-weight:bold;
	text-align:center;
}
.ms-form-price-boxes > .ms-membership-form {
    width: 300px;
    display: inline-block;
    vertical-align: middle;
    font-size: 14px;
    line-height: 1.8;
    padding-left: 15px;
    padding-right: 15px;
    margin-bottom: 30px;
    position: relative;
}
.ms-alert-box.ms-alert-success {
    border-top-color: #d9251d;
    color: white;
    background-color: #4e3880;
}
.gateway_stripe button.stripe-button-el{
	width: 421px;
	height: 87px;
	background:url(https://thothub.tv/wp-content/uploads/2018/08/stripebutton-1.png);
	background-repeat:no-repeat;
	box-shadow: none;
}

.gateway_stripe button.stripe-button-el > span{
	display:none !important;
}
i.wp-night-mode {
	border-style:solid;
	border-width:1px;
	border-color:white;
	padding:3px;

}
.g1-canvas-content .menu-item > a {
  padding-bottom: 10px;
}
.textwidget {
  padding-top: 0px;
}
a.faq {
    color: white;
}
a.chaturbate {
